const router = new Router({
  mode: 'history',
  base: process.env.BASE_URL,
  routes: [
    {
      path: '/login',
      component: () => import('@/views/dashboard/login/Login'),
    },
    {
      path: '/',
      component: () => import('@/views/dashboard/Index'),
      children: [
        // Cluster
        {
          name: '클러스터',
          path: '',
          component: () => import('@/views/dashboard/pages/Cluster'),
        },
        {
          name: '유저',
          path: '/pages/users',
          component: () => import('@/views/dashboard/pages/Users'),
        },
        {
          name: '상세페이지',
          path: '/c/',
          component: () => import('@/views/dashboard/pages/Detail'),
        },
      ],
    },
  ],
})

let isClusterPause = true;
let clusterTimer

router.beforeEach(function (to, from, next) {

  console.log('router >>>> ' + store.state.bearerToken)
  console.log('router >>>> ' + store.state.userId)


  let time = new Date()
  let nowTime = time.getTime()

  function startClusterGetTimer(){
    isClusterPause = false
    clusterTimer = setInterval(function (){
      cluster.methods.cluster_Get()  
    },5000)
  }
  function  stopClusterGetTimer(){
    clearInterval(clusterTimer)
    isClusterPause = true;
  }

  if(store.state.loginTime != '' && nowTime - store.state.loginTime >= 7200000){
    store.commit('SET_TOKEN', '')
    store.commit('SET_USERID', '')
    store.commit('SET_NAME', '')
    store.commit('SET_TIME', '')
    if(!isClusterPause) stopClusterGetTimer()
    next('/login')
  }
  else if (to.path=='/login'){
    if(store.state.bearerToken != '' && store.state.userId != ''){
      next('/')
    }else{
      if(!isClusterPause){
        stopClusterGetTimer()
      }
      next()
    }

  }
  else{
    if(store.state.bearerToken == '' || store.state.userId == ''){
      if(!isClusterPause){
        stopClusterGetTimer()
      }
      next('/login')
    }else if(to.path=='/'){
      if(isClusterPause){
        startClusterGetTimer()
      }
      next()
    }else{
      if(!isClusterPause){
        stopClusterGetTimer()
      }
      next()
    }
  }

})



export default router
